class ForList extends EnigmaticElement{innerTemplate="";constructor(){super()}set(a){this.innerTemplate||(this.innerTemplate=this.innerHTML),this.innerHTML="";for(const b of a){let a=this.innerTemplate;for(const c of a.match(/\{\{(.*?)\}\}/g)){const d=c.replace(/{{|}}/g,"").split(".");let e,f=b;for(;e=d.shift();)f=f[e];a=a.replace(c,f)}this.innerHTML+=a}}}customElements.define("for-list",ForList);